import Link from 'next/link';

const Navbar = () => (
    <div className="j-top-nav">
        <div className='j-top-nav-container'>
            <div className="j-logo">
                <img src="https://image.shutterstock.com/image-vector/mountain-logo-260nw-505360261.jpg" style={{width: '10rem'}}/>
            </div>
            <div className="j-content-container">
                <div className="j-flex">

                </div>
                <div className="j-flex">
                    <div className="j-nav-item">Home</div>
                    <div className="j-nav-item">Categories</div>
                    <div className="j-nav-item">Collections</div>
                    <div className="j-nav-item">All Products</div>
                </div>
            </div>
        </div>
        <style jsx>{`
            .j-top-nav-container {
                margin: 10px 5%;
            }
            .j-flex {
                display: flex;
            }
            .j-nav-item {
                display: inline-block;
            }
            .j-logo {
                display: inline-block;
            }
        `}</style>
    </div>
)

export default Navbar
